const AboutHeader = () => (

    <div className='about-header'>
        <div className='about-header-content'>
            <div className='header-title1'>WE CARE ABOUT</div>
            <div className='header-title2'>YOUR CONCERNS</div>
        </div>
    </div>

);

export default AboutHeader;
